import { logo } from "./logo.js";
import {colors} from "./colors.js";
import {dialog} from "./dialog.js";
import {inspection} from "./inspection.js";

let version = '1.3.3';
let current = kernel.getProp('cstpv');

export function ui(lang, code) {
    let plusLang = lang();
    logo(plusLang, code);
    colors(plusLang, code);
    inspection(plusLang);
    $(document).on('dialogs_enabled', function() {
        if (!Boolean(kernel.getProp('cstpIntro'))) {
            $('html').addClass('cspt');
            dialog('csTimer+',
                '<div style="line-height: 26px;"><h4>' + plusLang.PLUS_SLOGAN + '</h4>\n' +
                '        <p>' + plusLang.PLUS_WELCOME_LINE_1 + '</p><p>' + plusLang.PLUS_WELCOME_LINE_2 + '</p>\n' +
                '        <p>' + plusLang.PLUS_WELCOME_LINE_3 + '</p>\n' +
                '        <table class="table" style="margin: 0 auto">\n' +
                '            <tbody>\n' +
                '                <tr>\n' +
                '                    <th>' + plusLang.PLUS_FEATURE + '</th>\n' +
                '                    <th>' + plusLang.PLUS_CONFIGURATION + '</th>\n' +
                '                </tr>\n' +
                '                <tr>\n' +
                '                    <td>' + plusLang.PLUS_USE_MODERN_UI + '</td>\n' +
                '                    <td><select name="introUi"><option value="y" selected="">' + plusLang.PLUS_YES + '</option><option value="n">' + plusLang.PLUS_NO + '</option></select></td>\n' +
                '                </tr>\n' +
                '                <tr>\n' +
                '                    <td>' + plusLang.PLUS_USE_WCA_INSPECTION + '</td>\n' +
                '                    <td><select name="introInspection"><option value="a" selected="">' + plusLang.PLUS_ALWAYS + '</option><option value="b">' + plusLang.PLUS_EXCEPT_BLD + '</option><option value="n">' + plusLang.PLUS_NO + '</option></select></td>\n' +
                '                </tr>\n' +
                '                <tr>\n' +
                '                    <td>' + plusLang.PLUS_USE_NEW_VOICES + '</td>\n' +
                '                    <td><select name="introVoices"><option value="y" selected="">' + plusLang.PLUS_YES + '</option><option value="n">' + plusLang.PLUS_NO + '</option></select></td>\n' +
                '                </tr>\n' +
                '            </tbody>\n' +
                '        </table>\n' +
                '        <p><small>' + plusLang.PLUS_WELCOME_REMINDER + '</small></p>\n' +
                '    </div>',
                function () {
                    let introUi = $('select[name=introUi]').find('option:selected').val();
                    let useIns = $('select[name=introInspection]').find('option:selected').val();
                    let plusIns = $('select[name=introVoices]').find('option:selected').val();
                    if (plusIns == 'y') {
                        kernel.setProp('plusIns', 'rand');
                        kernel.setProp('voiceIns', 'n');
                    }
                    if (introUi == 'y') {
                        kernel.setProp('cspt', true);
                    }
                    kernel.setProp('useIns', useIns);
                    kernel.setProp('cstpIntro', true);
                },
                function () {
                    $('html').removeClass('cspt');
                    kernel.setProp('cstpIntro', true);
                }
            );
        } else if (current != version) {
            let changelog = '<ul>' +
                    '<li>1- <b>Mats Valk</b> acaba de chegar ao time de vozes do csTimer+ e com ele muitas novidades e easter eggs!</li>' +
                    '<li>2- Adicionada opção de escolher seu país para receber alertas de vozes de NRs, CRs e WRs da WCA.</li>' +
                    '<li>3- Adicionada opção de ouvir vozes de inspeção mais curtas quando possível.</li>' +
                    '<li>4- Criadores de conteúdo agora podem criar variações de vozes existentes.</li>' +
                    '<li>5- Agora é possível pular quaisquer vozes apertando a tecla ESC.</li>' +
                    '<li>6- Esta atualização marca nosso lançamento no <b>Safari para macOS</b>!<br>Caso seja seu navegador principal, abra o site <a href="https://cstimer.plus" target="_blank">https://cstimer.plus</a> e clique no botão para ir até a AppStore.<br><small>Agradecemos imensamente ao usuário <a href="https://www.reddit.com/user/themizarkshow" target="_blank">@themizarkshow</a> no Reddit, quem generosamente nos patrocinou um ano de assinatura Apple Dev.<br>Mostre sua gratidão, visitando o site dele, clicando <a href="https://themizarkshow.com/" target="_blank">aqui</a>.</small></li>' +
                    '<li>7- Adicionado novo código secreto para um criador de conteúdo brasileiro.</li>' +
                    '<li>8- Corrigido bug que fazia com que vozes de pbs e dnfs tocassem ao trocar de sessão.</li>' +
                '</ul>' +
                '<br><b>v.1.3.2</b><br><br>' +
                '<ul>' +
                    '<li>1- Adicionada opção de parar o timer automaticamente em 1 hora no MBLD.</li>' +
                    '<li>2- Adicionada opção de customizar o som de alerta quando o timer para no MBLD.</li>' +
                    '<li>3- Corrigido tema plus-rgb para deixá-lo mais stealth.</li>' +
                '</ul>' +
                '<br><b>v.1.3.1</b><br><br>' +
                '<ul>' +
                    '<li>1- Ao definir o tamanho de embaralhamento de uma sessão, ele permanecerá configurado ao reiniciar o timer.</li>' +
                    '<li>2- É possível inserir comentários novamente no modo de digitação utilizando o padrão TEMPO[comentário].</li>' +
                    '<li>3- Adicionada opção de fazer upload de uma imagem de fundo diretamente do computador.</li>' +
                    '<li>4- Desbloqueie um tema especial resgatando o código <span style="color: #cd1b1b">R</span><span style="color: #38d238">G</span><span style="color: #1d1dd6">B</span> com as teclas <b>SHIFT + C</b>!</li>' +
                '</ul>' +
                '<br><b>v.1.3.0</b><br><br>' +
                '<ul>' +
                    '<li>1- Damos as boas-vindas a duas ilustríssimas pessoas (ou talvez 3...), <b>Olor e Tingman</b>! Eles trazem várias novas vozes e easter eggs para você descobrir!</li>' +
                    '<li>2- Durante a inspeção wca, a mesma pessoa falará os alertas de 8 e 12 segundos caso você utilize o modo aleatório de vozes.</li>' +
                    '<li>3- Esta atualização vem para comemorar os mais de 4000 usuários ativos em todas as plataformas, obrigado por usar o csTimer+!</li>' +
                '</ul>' +
                '<br><b>v.1.2.9</b><br><br>' +
                '<ul>' +
                    '<li>1- Começamos oficialmente a temporada de updates para 2021, desta vez com algumas melhorias de qualidade de vida!</li>' +
                    '<li>2- Agora é possível ativar a inspeção WCA no modo de digitação sem clicar no botão, basta apertar a barra de espaço.</li>' +
                    '<li>3- A função de alterar o zoom agora funciona com o visual do csTimer+, encorajamos todos a testarem qual zoom mais gostam!</li>' +
                '</ul>';
            if (kernel.getProp('lang') != 'pt-pt') {
                changelog = '<ul>' +
                        '<li>1- <b>Mats Valk</b> has just arrived at csTimer+\'s voice cast and brings lots of new features and easter eggs!</li>' +
                        '<li>2- Added an option to choose your country for WCA\'s NRs, CRs and WRs voice alerts.</li>' +
                        '<li>3- Added an option to hear shorter inspection voices when possible.</li>' +
                        '<li>4- Content creators can now add variations to their existing voices.</li>' +
                        '<li>5- It\'s now possible to skip any voices by pressing the ESC key.</li>' +
                        '<li>6- This update is also our debut on <b>Safari for macOS</b>!<br>If that is your main browser, go to <a href="https://cstimer.plus" target="_blank">https://cstimer.plus</a> and click on the button to get the extension in the AppStore.<br><small>Huge thanks to Reddit user <a href="https://www.reddit.com/user/themizarkshow" target="_blank">@themizarkshow</a>, who generously donated us 1 year of Apple Dev.<br>Show him some love by visiting his website, click <a href="https://themizarkshow.com/" target="_blank">here</a>.</small></li>' +
                        '<li>7- Added a secret code for a brazilian content creator.</li>' +
                        '<li>8- Fixed a bug that replayed pb and dnf\'s voices while changing between sessions.</li>' +
                    '</ul>' +
                    '<br><b>v.1.3.2</b><br><br>' +
                    '<ul>' +
                        '<li>1- Added an option to automatically stop the timer in 1 hour while in MBLD.</li>' +
                        '<li>2- Added an option to customize the sound alert when the timer stops in MBLD.</li>' +
                        '<li>3- Tweaked plus-rgb theme for a stealthier look.</li>' +
                    '</ul>' +
                    '<br><b>v.1.3.1</b><br><br>' +
                        '<li>1- When a custom scramble length is set for a session, it will stay as defined even after refreshing the timer.</li>' +
                        '<li>2- It was made possible again to add comments to a solve in typing mode by using the pattern TIME[comment].</li>' +
                        '<li>3- Added a direct upload option for setting background images instead of just using urls.</li>' +
                        '<li>4- Unlock a special theme by redeeming the code <span style="color: #cd1b1b">R</span><span style="color: #38d238">G</span><span style="color: #1d1dd6">B</span> with the <b>SHIFT + C</b> shortcut!</li>' +
                    '</ul>' +
                    '<br><b>v.1.3.0</b><br><br>' +'<ul>' +
                        '<li>1- We\'d like to welcome two amazing people (or maybe 3...), <b>Olor and Tingman</b>! They both bring tons of new voices and easter eggs for you to find out!</li>' +
                        '<li>2- During wca inspection, the same person will alert you with the 8 and 12 seconds mark in case you\'re using the random mode for voices.</li>' +
                        '<li>3- This update comes to celebrate our newest milestone: more than 4k active users across all platforms are using csTimer+, thank you so much!</li>' +
                    '</ul>' +
                    '<br><b>v.1.2.9</b><br><br>' +
                    '<ul>' +
                        '<li>1- We\'ve officially begun the update season for 2021, this time we\'re bringing some quality of life changes!</li>' +
                        '<li>2- Instead of just clicking the button, you can now activate WCA inspection with the space bar while on typing mode.</li>' +
                        '<li>3- The zoom function now works with csTimer+ UI, we encourage everyone to try it out!</li>' +
                    '</ul>';
            }
            dialog(
                'csTimer+ (' + plusLang.PLUS_VERSION + ' ' + version + ')',
                '<br><b>' + plusLang.PLUS_WHATS_NEW + ' v.' + version + '</b><br><br>' + changelog,
                0,
                undefined,
                0
            );
            kernel.setProp('cstpv', version);
        }
    });
    $('link[rel=apple-touch-icon]').attr('href', "data:image/png;base64,");
    $('head').append($('<link rel="icon" />').attr('href', "data:image/png;base64,"));
    document.title = ' csTimer+ - Professional Rubik\'s Cube Speedsolving/Training Timer ';
}